7 RCR...Projecting India's Future is an Indian television politics-based reality series/documentary series, hosted by Indian author, columnist, and speaker Chetan Bhagat on Hindi news channel ABP News, which premiered on January 11, 2014. This is a show of dramatized biographies of all those who have the mettle to make it to 7 Race Course Road, the Prime Minister's official residence ,presented in the most interesting manner.It aims to bring to the audience the never seen before facts of Indian history.The show airs every Saturday at 10 PM on ABP news. 7 RCR is a show in lead up to Indian general election, 2014.

